(async () => {
	const puppeteer = require("puppeteer");
	const fs = require("fs");
	const path = require("path");

	const browser = await puppeteer.launch({
		headless: true,
		defaultViewport: {
			width: 830,
			height: 990,
		},
	});
	const page = (await browser.pages())[0];

	let content = `<!DOCTYPE html><html><head><style>@import url('https://fonts.googleapis.com/css2?family=Rancho&display=swap');html, body{margin: 0;padding: 0;background-color: #386bb7; overflow: hidden;}#calendar{position: relative; width: 740px; height: 740px; margin: 0 auto; z-index: 12;display: grid;grid-template-columns: repeat(5, 1fr);gap: 20px 20px;padding: 20px;}.day{position: relative;width: 100%;height: 100%;background-color: #ecc11b;display: flex;align-items: center;justify-content: center;border-radius: 5px;}.day.not-resolved{background-color: transparent;}.day .gift{position: absolute;top: 0;left: 0;right: 0;bottom: 0;display: flex;align-items: center;justify-content: center;}.day .gift-image{width: 120px;height: 120px;}.day h1{margin: 0;padding: 0;font-family: Arial, Helvetica, sans-serif;color: black;font-size: 15px;}#paysage{position: relative; width: 840px;height: 840px;background-color: #386bb7;}#snow{position: absolute; bottom: 0; left: 0; right: 4px; height: 200px; z-index: 10; background: url(data:image/png;base64,) no-repeat center; background-size: 100% 100%;}#snow2{position: absolute; bottom: 0; left: 0px; right: 0; height: 200px; z-index: 15; background: url(data:image/png;base64,) no-repeat center; background-size: 100% 100%;}.tree{position: absolute;}.tr-1{bottom: 10px; left: 10px; height: 200px;}.tr-2{bottom: 60px; left: 170px; height: 300px;}.tr-3{bottom: 55px; left: 280px; height: 170px; transform: rotateY(180deg);}.tr-4{bottom: 40px; left: 430px; height: 170px;}.tr-5{bottom: 65px; left: 500px; height: 170px; transform: rotateY(180deg);}.tr-6{bottom: 2px; left: 580px; height: 230px; transform: rotateY(180deg);}.tr-7{bottom: 145px; right: 20px; height: 200px; transform: rotate(-13deg);}.tr-8{bottom: 105px; left: 20px; height: 240px; transform: rotate(13deg);}.tr-9{bottom: 105px; left: 350px; height: 340px;}#snowing{position: absolute; bottom: 0; left: 0; top: 0; width: 840px; z-index: 1; background: url(data:image/png;base64,) center center repeat scroll, url(data:image/png;base64,) center center repeat fixed; animation: snowing 1s linear infinite;}@-webkit-keyframes snowing{from{background-position-y: 0px, 0px;}to{background-position-y: (450px * 2), 450px;}}@-moz-keyframes snowing{from{background-position-y: 0px, 0px;}to{background-position-y: (450px * 2), 450px;}}@-ms-keyframes snowing{from{background-position-y: 0px, 0px;}to{background-position-y: (450px * 2), 450px;}}@-o-keyframes snowing{from{background-position-y: 0px, 0px;}to{background-position-y: (450px * 2), 450px;}}@keyframes snowing{from{background-position-y: 0px, 0px;}to{background-position-y: (450px * 2), 450px;}}#title{margin: 0; text-align: center; padding: 25px 0 0 0; background-color: transparent; width: 840px; color: white; font-size: 80px; font-family: 'Rancho', Arial, sans-serif;}#subtitle{margin: 30px 0 -30px 0; text-align: center; padding: 0; background-color: transparent; width: 840px; color: white; font-size: 30px; font-family: 'Rancho', Arial, sans-serif;}#paysage::after{content: ""; position: absolute; top: 0; left: 0; right: 0; height: 20px; z-index: 100;}#mountain{position: absolute; left: 0; right: 0; bottom: 65px; height: 600px; background: url(data:image/png;base64,) no-repeat center bottom; background-size: contain;}#mountain::after{content: ""; position: absolute; left: 0; right: 0; bottom: 100px; height: 600px; background: url(data:image/png;base64,) no-repeat center bottom; background-size: 100% 100%;}</style></head><body> <h2 id="subtitle">thomasync</h2> <h1 id="title">Advent Of Code 2022</h1> <div id="snowing"></div><div id="paysage"> <div id="mountain"></div><div id="calendar"></div><div id="snow"> <img src="data:image/png;base64," class="tree tr-2"> <img src="data:image/png;base64," class="tree tr-3"> <img src="data:image/png;base64," class="tree tr-5"> <img src="data:image/png;base64," class="tree tr-7"> <img src="data:image/png;base64," class="tree tr-8"> <img src="data:image/png;base64," class="tree tr-9"> </div><div id="snow2"> <img src="data:image/png;base64," class="tree tr-1"> <img src="data:image/png;base64," class="tree tr-4"> <img src="data:image/png;base64," class="tree tr-6"> </div></div><script>const resolveds={{resolveds}};for (let i=1; i <=25; i++){let day=document.createElement("div");day.classList.add("day");let gift=document.createElement("div");gift.classList.add("gift");let h1=document.createElement("h1");h1.innerText=i;let image=document.createElement("img");image.src="data:image/svg+xml;base64,";image.classList.add("gift-image");day.appendChild(image);const resolved=resolveds.find((resolved)=> resolved.day==i);if (resolved){image.src=resolved.image;}else{day.classList.add("not-resolved");gift.appendChild(h1);}day.appendChild(gift);document.getElementById("calendar").appendChild(day);}</script></body></html>`;

	const resolveds: {
		day: number;
		image: string;
	}[] = [];

	fs.readdirSync("imgs").forEach((file: string) => {
		if (file.match(/\d{1,2}\./)) {
			resolveds.push({
				day: parseInt(file.split(".")[0]),
				image:
					"data:image/png;base64," +
					fs.readFileSync(path.join(__dirname, "imgs/", file)).toString("base64"),
			});
		}
	});

	content = content.replace("{{resolveds}}", JSON.stringify(resolveds));

	await page.setContent(content);

	await page.waitForTimeout(600);
	await page.screenshot({ path: path.join(__dirname, "imgs/calendar.png") });

	await browser.close();
})();
